import "./App.css";
import { MapContainer, TileLayer, Marker } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import L from "leaflet";

function App() {
  const markers = [
    {
      location: [48.85, 2.35],
      title: "Helllo 1",
    },
    {
      location: [48.85, 2.35],
      title: "Helllo 2",
    },
    {
      location: [48.85, 2.35],
      title: "Helllo 3",
    },
  ];

  const customIcon = L.icon({
    iconUrl: "path/to/your/marker-icon.png", 
    iconSize: [32, 32], 
    iconAnchor: [16, 32], 
  });

  return (
    <>
      <MapContainer zoom={13} center={[48.85, 2.35]}>
        <TileLayer
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright" target="_blank">OpenStreetMap contributors</a>'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        {markers.map((marker) => (
          <Marker position={marker.location}></Marker>


        ))
        }
      </MapContainer>
    </>
  );
}

export default App;
